let OnClickHandler = (props) => {

    props.name = props.Name;
    return (

        <div id={props.id} onClick={() => this.clickChar([props.id])}>
         {console.log("clicked")};
        <img src={props.src} alt="Pic" />
        <h2>{props.Name}</h2> 
     </div> 
        )
    }

